person: .word 7744, 7745, 7746, 7875, 7874, 7873, 7872, 7871, 8000, 8001, 8002
# PERSONAGEM COR 65584 a 65628
personColor: .word 0x00ffff00, 0x00ffff00, 0x00ffff00, 0x00ffff00, 0x00ff, 0x00ffff00, 0x00ff, 0x00ffff00, 0x00ffff00, 0x00ffff00, 0x00ffff00
#inimigos 65624 a 65752
e1: .word 192, 193, 194, 323, 322, 321, 320, 319, 448, 449, 450
e2: .word 167, 168, 169, 298, 297, 296, 295, 294, 423, 424, 425
e3: .word 147, 148, 149, 278, 277, 276, 275, 274, 403, 404, 405
#cores 65752 a 65884
corE: .word 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x00ff, 0x0000ff00, 0x00ff, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00 
corE2: .word 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x00ff, 0x0000ff00, 0x00ff, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00 
corE3: .word 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x00ff, 0x0000ff00, 0x00ff, 0x0000ff00, 0x0000ff00, 0x0000ff00, 0x0000ff00 
#move 65888
movE: .word 1 1 1

.text
	main:
		lui $s0, 0x1001 #S0  o inicio do mapa
		
		add $a0, $s0, $0 #display
		addi $a1, $s0, 32764 #mapa
		add $a2, $0, $0 #iterador
		jal paintMap
		
		j loop
		
	loop:	
		add $a0, $0, $s0 # onde o mapa comeca
		addi $a1, $s0, 65536 #onde o personagem comeca
		add $a3, $0, $0 #index de pixel
		jal paintPerson
		
		add $a0, $0, $s0 # onde o mapa comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		add $a3, $0, $0 #index de pixel
		jal paintEnemies
		
		addi $a0, $s0, 65536 # onde o personagem comeca
		add $a1, $0, $0 # iterador
		lui $a2, 0xffff #input buffer
		jal handleInput
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		addi $a2, $s0, 65888 #onde os inimigos movimento
		jal moveEnemies
		
		#addi $v0, $0, 10
		#syscall
		
		j loop
		
	# Usa: a0  onde o display comeca; a1: onde desenho do mapa comeca
	# Suja: t1, t2
	paintMap:
		lw $t1, 0($a1)
		sw $t1, 0($a0)
		addi $a0, $a0, 4 # Densidade  4
		addi $a1, $a1, 4 # ..
		addi $a2, $a2, 1 # Quantidade pintados
		bne $a2, 8192, paintMap #quantidade total de pixels 128*64
		jr $ra
		
	# a0: onde o display comeca
	# a1: onde o personagem comeca
	handleMapChanges:
		
		
	# a0 onde o display comeca. 
	# a1 onde o personagem comeca
	# a3 index do pixel do personagem
	paintPerson:
		#Local da tela
		lw $t1, 0($a1)
		mul $t1, $t1, 4
		add $t1, $t1, $a0
		#----
		
		add $t3, $a1, 44 		
		lw $t2, 0($t3)
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a3, $a3, 1 
		bne $a3, 11, paintPerson
		
		jr $ra
		
	# a0 onde o display comeca
	# a1 onde os inimigos comecam
	# a3 index de iteracao 
	paintEnemies:
		#Local da tela
		lw $t1, 0($a1)
		mul $t1, $t1, 4
		add $t1, $t1, $a0 
		#----
		
		add $t3, $a1, 132		
		lw $t2, 0($t3)
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a3, $a3, 1 
		bne $a3, 33, paintEnemies
		
		jr $ra
	
	# a0: onde o display comeca
	# a1: onde os inimigos comecam	
	# a2: iterador
	clearEnemies:
		#Local da tela
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel
		#----
		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a2, $a2, 1
		bne $a2, 33, clearEnemies
		
		jr $ra	
		
	# a0: onde o display comeca
	# a1: onde os inimigos comecam
	# a2: onde os movimentos comecam
	moveEnemies:
		#movendo-se apenas em determinados tempos
	
		add $t3, $0, $a0
		add $t4, $0, $a1
		
		addi $v0, $0, 30
		syscall
		
		and $a0, $a0, 4095 #8191
		addi $a1, $0, 100 #1000
		div $a0, $a1
		mflo $a0
		addi $a0, $a0, 1
		
		addi $a1, $0, 2
			
		div $a0, $a1 #ver se  par
		mfhi $t0		
		beq $t0, $s1, endMovement #ver se mudou entre par e impar
		add $s1, $0, $t0
		
		add $a0, $t3, $0
		add $a1, $t4, $0
		#end move
		
		# limpa os iniimigos
		add $t3, $0, $a0
		add $t4, $0, $a1
		add $t5, $0, $a2
		add $t6, $0, $ra
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		add $a2, $0, $0
		jal clearEnemies
		
		add $a0, $t3, $0
		add $a1, $t4, $0
		add $a2, $t5, $0
		add $ra, $t6, $0
		#fim limpeza
		 
		addi $t0, $0, 0
		forEachEnemy:
			beq $t0, 33, endMovement
			
			lw $t4, 0($a2) # t4: movimento atual
			
			lw $t1, 20($a1) #Centro do e1
			mul $t2, $t1, 4 #local do display
		
			addi $t3, $t2, 1 #local andando pra direita
			lw $t3, 0($a0)
			bne $t3, 0x00, forEachEnemyPixel
			
			add $t5, $0, $0
			forEachEnemyPixel:
				beq $t5, 11, endForEachEnemyPixel
				
				lw $t6, 0($a1)
				add $t6, $t6, $t4
				sw $t6, 0($a1)
				
				add $a1, $a1, 4 #proximo local
				
				addi $t5, $t5, 1
				j forEachEnemyPixel
			
			
			endForEachEnemyPixel:
			
			addi $a2, $a2, 4 #passando para proximo Inimigo movimente
			addi $t0, $t0, 11 #pulando para proximo
			j forEachEnemy
			
		endMovement:
		jr $ra
		
		
	# a0: onde o display comeca
	# a1: onde o personagem comeca
	# a2: iterador
	clearPerson:
		#Local da tela
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel
		#----
		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a2, $a2, 1
		bne $a2, 11, clearPerson
		
		# - map color change -
		addi $a1, $a1, -24
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel

		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup	
		bne $t2, 0x00900000, jumpMapColorChange
		addi $t2, $0, 0x000090
		sw $t2, 32764($t1)
		
		jumpMapColorChange:
		
		jr $ra	
	
	handleInput:
		lw $t0, 0($a2)
		
		beq $t0, $0, endHandleInput # se n tiver no buffer
		
		#limpando personagem para mover
		add $t4, $ra, $0
		add $t5, $a0, $0
		add $t6, $a1, $0
		add $t7, $a2, $0
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65536 #onde o personagem comeca
		add $a2, $0, $0 #index de pixel
		jal clearPerson
		
		add $ra, $t4, $0
		add $a0, $t5, $0
		add $a1, $t6, $0
		add $a2, $t7, $0
		#end
		
		add $t1, $0, $0 # O quanto o personagem se movera 
		lw $t3, 4($a2)
		
		beq $t3, 'a', minus1
		beq $t3, 's', more128
		beq $t3, 'd', more1
		beq $t3, 'w', minus128
		
		minus1:
			addi $t2, $0, -1
			j endMore
		
		minus128:
			addi $t2, $0, -128
			j endMore
			
		more1:
			addi $t2, $0, 1
			j endMore
			
		more128:
			addi $t2, $0, 128
			j endMore
		
		endMore:
		#verificar se o boneco fica no preto	
		lw $t1, 20($a0) #pega pixel central do boneco
		add $t1, $t1, $t2 #adiciona a quanto vai aumentar
		mul $t1, $t1, 4 #multiplica por 4
		add $t1, $t1, $s0 #adiciona ao endereco inicial do display
		lw $t3, 0($t1)
		beq $t3, 0x00, endHandleInput
		
		changePosition:
			lw $t1, 0($a0)
			add $t1, $t1, $t2		
			sw $t1, 0($a0)
			
			addi $a0, $a0, 4	
			addi $a1, $a1, 1		
			bne $a1, 11, changePosition
				
		endHandleInput:
		jr $ra
	
		
	
	

